export function basicGarbage(p,x,y,w,h){
    //p.beginShape()
  var up = y+h/2
  var down = y-h/2
  var left = x+w/2
  var right = x-w/2
  p.ellipse(x,y,w,h)
  p.ellipse(x,up,w,h)
  p.ellipse(x,down,w,h)
  p.ellipse(left,y,w,h)
  p.ellipse(right,y,w,h)
  //p.endShape()
}
